import useAxios from "../utils/useAxios";
import {useEffect} from 'react';

let user_id = 0
let username = ''

function Global_var(){

    const api = useAxios()
    useEffect(() => {
      const load_var = async ()=>{
        
        const id = await api.get("/userID/");
        user_id = id.data.response

        const un = await api.get("/username/");
        username = un.data.response
        
      }
      load_var()

  
    }, [api])


    return(
        <p></p>
      )
  }
  
export {user_id, username, Global_var};
